function random_state(T::DataType)
    q1 = T(π)*T(2)*(rand(T) - T(0.5))
    q2 = T(π)*T(2)*(rand(T) - T(0.5))
    vcat(
        cos(q1),
        sin(q1),
        cos(q2),
        sin(q2),
        T(0.25)*T(2)*(rand(T) - T(0.5)),
        T(0.25)*T(2)*(rand(T) - T(0.5))
    )
end


